import React from "react";
import { FirstName, LastName, Address } from "./App";

const CompC = () => {
  return (
    <>
      <FirstName.Consumer>
        {(fname) => {
          return (
            <LastName.Consumer>
              {(lname) => {
                return (
                  <Address.Consumer>
                    {(addr) => {
                      return (
                        <h1>
                          My name is {fname} {lname} And address is {addr}.
                        </h1>
                      );
                    }}
                  </Address.Consumer>
                );
              }}
            </LastName.Consumer>
          );
        }}
      </FirstName.Consumer>
    </>
  );
};

export default CompC;
